export const actionTypes = {
    GET_ALL_QBANK_SUB_CATEGORY_REQUEST: 'GET_ALL_QBANK_SUB_CATEGORY_REQUEST',
    GET_ALL_QBANK_SUB_CATEGORY_SUCCESS: 'GET_ALL_QBANK_SUB_CATEGORY_SUCCESS',
    GET_INACTIVE_QBANK_SUB_CATEGORY_REQUEST: 'GET_INACTIVE_QBANK_SUB_CATEGORY_REQUEST',
    GET_INACTIVE_QBANK_SUB_CATEGORY_SUCCESS: 'GET_INACTIVE_QBANK_SUB_CATEGORY_SUCCESS'
};

export function getAllQBankSubCategory(payload) {
    return { type: actionTypes.GET_ALL_QBANK_SUB_CATEGORY_REQUEST, payload };
}

export function getAllQBankSubCategorySuccess(payload) {
    return { type: actionTypes.GET_ALL_QBANK_SUB_CATEGORY_SUCCESS, payload };
}

export function getInactiveQBankSubCategory(payload) {
    return { type: actionTypes.GET_INACTIVE_QBANK_SUB_CATEGORY_REQUEST, payload };
}

export function getInactiveQBankSubCategorySuccess(payload) {
    return { type: actionTypes.GET_INACTIVE_QBANK_SUB_CATEGORY_SUCCESS, payload };
}
